import React from 'react';

  function ButtonLink(props) {
    // props => { className: "o que alguém passar", href: "/"}
    return(
      <a className={props.className} href={props.href}>
        {props.children}
        {console.log(props)}
      </a>
    );
  }

export default ButtonLink;
